text:
코로나 때문에 취소할까 망설였는데 안봤으면 후회할뻔 했어요 ㅠㅠ 배우분들 너무 잘하시고 노래도 좋고 뭔가 감동받고 왔습니다. 과거도 미래도 아닌 현재를 잘 살아야겠다는 마음도 들고, 몸도 마음도 건강하게!!
어렸을때 봤을땐 이런 느낌은 아니었는데^^;
한번만 보긴 아쉬운 공연이었어요!!

어떤 날은 좋고 어떤 날은 안좋고 어떤 날은 소리가 작고 어떤 날은 너무 크고... 대부분의 공연장들이 음향이 좋지 않다는 후기가 많은데 셋팅에 따라서도 공연날마다 달라지니 아쉽네요.

근데 물 새는 건 언제 고칠지 궁금하네요.
장마가 길어지는데 객석 2층 갈때마다 물 받고 있는 거 보면... 이 공연이랑 참 잘 어울리는 상황이란 생각은 되는데 백화점에 영화관, 호텔까지 있는 복합문화공간인데... 눈 많이 와서 녹아도 물이 새겠군요;;

&#65279;
노래가 너무 좋고 배우들의 실력도 하나같이 훌륭해서 공연 내내 즐거웠던 뮤지컬.

얼마 전 영화를 봤던 터라 계속 생각나고 비교 되었는데 뮤지컬 공연이 훨씬 더 멋지네요.

&#65279;

7/3 공연.

내가 가장 사랑하는 뮤지컬 렌트. 거의 모든 노래 가사를 외울 정도인 이 작품. 이번 공연도 기대하는 마음으로 예매를 했다. 나름 가장 기대되는 배우들의 조합으로 엄선해서.

그런데 배우들의 수준은 기대 이하였다. 노래실력으로만 본다면 모두 매우 좋았다. 한국 뮤지컬을 보며 언제 삑사리가 날지 조마조마하는 학부모의 심정으로 보는 시기는 지났음을 새삼 실감했다.

그러나 연기의 개연성과 대사 한줄 한 줄에 대한 연구가 부족했다. 물론 우리 나라는 마약, 에이즈, 성인샵 댄서, 행위예술, 돈이 없어 병원이 못가는 것 같은 상황이 주변에서 흔하게 경험할 수 있지는 않지만, 적어도 이 작품을 올리는 사람이라면, 여행지로서의 화려한 뉴욕이 아니라 적은 돈으로 거대한 쳇바퀴인 뉴욕에서 살아가는 젊은이들의 상황을 연구했어야 했다.

&#8203;

&#8203;

로저 오종혁은 아이돌 가수 출신이라는데, 역시 무대에서 가장 빛나는 외모였다. 프로필 사진과 좀 다른 모습이지만 훨씬 낫다. 첫 뭄대부터 굉장한 집중력으로 극을 이끌어나갔고, 노래 연기 모두 출중했다. 다만, 1년간 마약 재활센터에 있다가 이제 나와 내노래를 찾겠다고 기타만 두두리는 사람의 잘 다듬어져 기름발린 헤어스타일은 좀 아니지 싶다. 그래도 어제 공연에서 완벽했던 배우 2명은 로저 오종혁과 콜린 최재림이었다.

&#8203;

콜린 최재림은 오리지널 렌트와 가장 싱크로율이 높은 음색을 가지고 있다. 한음 한음 강약과 감정을 완벽하게 실어냈고, 심지어는 마지막 곡 까지 모든 사소한 몸짓과 행동에 개연성을 부여하여 연기했다. 그리하여 그가 2막에서 부른 I''ll cover you 가 가장 감동적인 뮤지컬 넘버가 된 듯하다.

&#8203;

엔젤 김호영. 이런 캐릭터는 어느 작품에서나 가장 큰 호응을 얻기 마련인데, 아쉬움이 크다. 게이 역은 모두 과장된 ''여성스러운'' 몸짓으로 일관하기 일쑤지만, 김호영은 초반부터 남자의 목소리와 몸짓을 일부러 많이 섞은 듯 보인다. 그러한 다양한 해석은 마음에 들지만, 뉴욕에서 그러한 캐릭터들이 어떠한 몸짓과 태도를 보통 보이는지는 경험이 부족한 건 아닐까 싶다. 훨씬더 사랑스럽게 그릴 수 있는 캐릭터임에도 몰입도가 매우 낮았다.

&#8203;

미미 김수하. 일부러 아이비가 아닌 김수하의 공연을 선택했는데 이런... 미미의 첫 솔로곡 Out tonight 의 초반에 애기처럼 발성해서 깜짝 놀랐다. 파이프라인을 타며 섹시하게 부르는 movement는 괜찮은 정도였지만, 스트리퍼로 생계를 유지하는 여자의 디테일한 움직임이 없다. 그저 안무실에서 춤 연습해온 댄서의 모습. 2막에서 두려움과 질투에 떠나는 로저를 잡지 못하고 죽음에 두려워 하는 노래를 부를 때는 단순한 슬픔만을 표현했다. 죽음이라는 인간 본질의 고통과 두려움을 표현하기에는 고민이 부족한 듯 보였다.

&#8203;

조앤 정다희. 첫 등장하는 전화부스에서의 여러 전화통화로 그녀의 캐릭터를 표현해야 하는데, 빽 내지르는 발성에 몰입하기 힘들었다. 리딩하는 레즈비언이라 커트머리를 했겠지만, 그녀의 얼굴형과, 고개를 저을 때마다 칼같이 춤을 추는 생머리가 잘 어울리지 않았다. 연기와 노래에서 강약조절에 가장 아쉬움이 남는 배우는 개인적으로 조앤과 미미였다.

&#8203;

모린 전나영이 가장 기대되었다. 네델란드에서 자라 타지에서 경력을 쌓아 한국에 들어온 배우이고 이 작품에서 끼를 맘껏 펼쳤다는 기사를 보고 렌트의 공연 소식을 접했기 때문이다. 물론 소의 젖을 짜는 퍼포먼스를 하는 장면은 워낙 원작이 강하기 때문에 보통 수준이었지만, 모린은 이 작품에서 가장 예측불가의 캐릭터이다. 첫 등장부터 완전 사이코의 포스를 풍기며 시종일관 관객을 휘어잡아야 하는데, 준비된 몇 군데에서만 그런 모습이 보이고 전체적으로 그런 분위기를 표현하지 못했다.

&#8203;

마크 정원영. 초반에 로저와 둘이 노래를 부르는 데에서 좀 음이 불안정하긴 해지만, 극 내내 나레이터의 역할로 가장 오래 무대에 있는 것 같은 마크 배역을 잘 소화했다. 그치만 위에서 언급한 뉴욕과 상황에 대한 연구가 부족하다는 인상은 지울 수가 없다. 예를 들어, 친구들의 참석하는 에이즈환우 소모임을 촬영하러 뒤늦게 들어갔을 때, 진행자가 자기 소개를 부탁하자 아.. 나는 그저 친구를 따라 왔다는 말을 하는데, 그게 나는 너희와 다른 환자라는 말을 둘러 표현한 것이다. 그 애매한 감정을 충분히 전달해주지 못했다. 그저 모임에 좀 늦어 소개를 주저하는 사람처럼 보였다. 이는 2막 후반에 카메라 뒤로 숨는 마크를 블레임하는 로저에게 "어짜피 나만 남을 거잖아"라는 대사와 일맥상통한다. 너희는 짧은 생을 마감하고 그 모든걸 안고 오래도록 살아가는 건 내가 될거잖아, 라는 차마 말하지는 못하지만 내재되어 있는 그 생각이 둘 사이에 터져버린 순간의 에너지와 후회와 상처 등등이 모두 생략되어 있다.

&#8203;

앙상블은... 조나단 라슨의 실제 에이즈로 죽은 친구들의 이름을 붙인 배역들이다. 할많하않...

&#8203;

2020년을 반영하여 대사를 조금 손보았는데, 관객들이 그렇게 빵터지는 대사는 없었다. 좀 오버하는 듯한 대사와 표현들.

&#8203;

렌트라는 작품은 친절하고 느리게 설명되는 작품이 아니라 노래 한곡에서 상황과 대사들이 오가며 빠르게 전개되는 작품이라 그런 감정과 상황의 변화를 짧은 호흡 안에서 배우가 충분히 보여주어야 하는데 그러한 표현이 참 부족했다.

&#8203;

간만에 보는 렌트라는 작품이 이렇게 실망스러워 참 안타깝다. 다음에는 드림팀의 공연을 꼭 좀 보고싶다.

내용은 불편한 것들이 좀 있었어요.
직장동료나 부모님과 보기에는 좀 민망할 것 같은;
그래도 좋은 넘버들과 배우들 연기가 좋아서 괜찮았던 공연이었어요~
